heroesApp.config(function($routeProvider){
  $routeProvider
    .when('/splash', {
      templateUrl: '../templates/page-splash.html',
      controller: 'splashController'
    })
    .when('/intro/:id', {
      templateUrl: '../templates/page-intro.html',
      controller: 'introController'
    })
    .when('/index', {
      templateUrl: '../templates/page-index-heroes.html',
      controller: 'indexHeroesController'
    })
    .when('/show/:id', {
      templateUrl: '../templates/page-show-hero.html',
      controller: 'showHeroController'
    })
    .when('/play', {
      templateUrl: '../templates/page-play-game.html',
      controller: 'playGameController'
    })
    .when('/end', {
      templateUrl: '../templates/page-end-game.html',
      controller: 'endGameController'
    })
    .otherwise({
      templateUrl: '../templates/page-splash.html',
      controller: 'splashController'
    })
});



// Factory to return localStorage item

heroesApp.factory('LocalStorageFactory', ['$q', function($q, ScenariosFactory){
  factory = {};

  factory.getLocalStorage = function(item) {
    var itemLocal = localStorage.getItem(item);
    if (itemLocal) {
      return JSON.parse(itemLocal);
    }
    else {
      localStorage.setItem(item, JSON.stringify({}));
      return JSON.parse(localStorage.getItem(item));
    }
  };

  factory.addLocalStorage = function(item, object) {
    var itemLocal = this.getLocalStorage(item);
    object.local = true;
    itemLocal[object.id] = object;
    localStorage.setItem(item, JSON.stringify(itemLocal));
  };

  factory.mockPromiseReturn = function(obj) {
    var myPromise = $q.defer();
    myPromise.resolve({
      data: obj
    });
    return myPromise.promise;
  };

  return factory;

}]);
// Factory to return all scenarios

heroesApp.factory('ScenariosFactory', ['$http', 'LocalStorageFactory', function($http, LocalStorageFactory){
  factory = {};
  var scenario = false;
  factory.getScenarios = function(){
    var request = $http.get('/api/scenarios');
    return request;
  };
  factory.getScenario = function(id){
    console.log("hello");
    var scenarioLocal = LocalStorageFactory.getLocalStorage('scenarios');
    if (scenarioLocal[id]) {
      return LocalStorageFactory.mockPromiseReturn(scenarioLocal[id]);
    }
    else {
      var request = $http.get('/api/scenarios/' + id);
      return request;
    }
  };
  factory.currentScenario = function() {
    return scenario;
  }

  factory.setScenario = function(data){
    scenario = data;
    console.log(data);
  }

  factory.resolveScenarioLocal = function(scenario){
    if (!scenario.local) {
      LocalStorageFactory.addLocalStorage('scenarios', scenario);
    }
  }
  return factory;
}]);
// Factory to return all Heroes

heroesApp.factory('HeroesFactory', ['$http', function($http){
  factory = {};
  var team = [];

  var locateHero = function(id){
    for (var i in team) {
      if (team[i].id === id) {
        return i
      }
    }
    return false;
  };
  factory.onTeam = function(id){
    if(locateHero(id)) {
      return true;
    }
    else {
      return false;
    }
  }
  factory.getHeroes = function(){
    var request = $http.get('/api/heroes');
    return request;
  };
  factory.getTeam = function(){
    return team;
  };
  factory.addToTeam = function(data){
    if (team.length < 4 && !locateHero(data.id)) {
      team.push(data);
    }
  };
  factory.removeFromTeam = function(id){
    var index = locateHero(id);
    console.log(index);
    if (index) {
      team.splice(index, 1);
    }
  };
  factory.resetTeam = function(){
    team = [];
  };

  return factory;
}]);

// Factory to return single hero

heroesApp.factory('HeroFactory', ['$http', 'LocalStorageFactory', function($http, LocalStorageFactory){
  factory = {};

  // Method will check if hero's data exist in local storage
  // will return mocked promise from local storage is so
  // will return http request otherwise

  factory.getHero = function(id){
    var heroLocal = LocalStorageFactory.getLocalStorage('heroes');
    if (heroLocal[id]) {
      return LocalStorageFactory.mockPromiseReturn(heroLocal[id]);
    }
    else {
      var request = $http.get('/api/heroes/' + id);
      return request;
    }
  }
  return factory;
}]);
// Splash Page Controller

heroesApp.controller('splashController', ['$scope', 'ScenariosFactory', 'HeroesFactory', function($scope, ScenariosFactory, HeroesFactory){
  $scope.pageClass = "pageSplash";
  ScenariosFactory.getScenarios().then(function(request){
    $scope.scenarios = request.data;
    $scope.scenarioId = false;
    HeroesFactory.resetTeam();
  })
}]);
// Intro Page Controller

heroesApp.controller('introController', ['$scope', 'ScenariosFactory', '$routeParams', 'LocalStorageFactory', function($scope, ScenariosFactory, $routeParams, $rootScope, LocalStorageFactory){
  $scope.pageClass = "pageIntro";
  $scope.params = $routeParams;

  // Define Scenario

  var id = $routeParams.id;
  console.log(id);
  ScenariosFactory.getScenario(id).then(function(request){
    ScenariosFactory.setScenario(request.data);
    $scope.scenario = ScenariosFactory.currentScenario();
    var scenario = $scope.scenario;
    ScenariosFactory.resolveScenarioLocal(scenario);
  });

}]);
